import React, { Component } from "react"

const ToDoList = (props) => {
  return (
    <div className="todo-list">
      <ul>
        {props.listItems.map((item, idx) => {
          return <li>{item.name}</li>
        })}
      </ul>
    </div>
  )
}

export default ToDoList
